import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import "./index.css";
import Home from "./components/Home";
import  { useEffect, useState } from "react";




useEffect(() => {
  const [loading, setLoading] = useState(true); // State for loading
  const [error, setError] = useState(null); // State for errors
  const fetchStockData = async () => {
    try {
      const companies = ["AAPL", "GOOGL"];
      const apiKey = "698de899fd974ad0aaa4245c677edb3e";
      const symbols = companies.join(",");

      const response = await axios.get(
        `https://api.twelvedata.com/time_series?symbol=${symbols}&interval=1day&apikey=${apiKey}`
      );

      console.log(response.data);
       // Log to verify the structure



     const responseData=response.data;
     console.log(responseData);



    } catch (err) {
      setError("Error fetching stock data");
    } finally {
      setLoading(false);
    }
  };

  fetchStockData();
}, []);


















const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/*" element={<Home />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);
